var app=new Vue({el:"#app",data:{tipList:[],aiHomeQueryList:[],search:"",num:6,tableData:[],loading:!1},created:function(){this.init()},methods:{init:function(){if(!this.loading){var t=this;this.loading=!0,this.getAiHomeQueryList().then(function(){t.formatList(t.aiHomeQueryList),t.loading=!1})}},querySearch:function(t,e){$axios({url:"/core/dm/botAPI/getSearchSuggest",method:"get",params:{queryKey:t}}).then(function(t){if(101===t.code){var i=t.data.map(function(t){return{value:t}});e(i)}else e([])}).catch(function(t){e([])})},getAiHomeQueryList:function(){return new Promise((t,e)=>{var i=this;this.aiHomeQueryList=[],$axios({url:"/core/dm/botAPI/aiHomeQuery",method:"get"}).then(function(e){101===e.code&&e.data.forEach(function(t){1===t.type?i.aiHomeQueryList.push(t.content):4===t.type&&i.tipList.push(t.content)}),t()}).catch(function(t){e(t)})})},handleSelect:function(t){location.href="/login?refer="+encodeURIComponent("/plastic/ai?question="+t)},formatList:function(t){var e=this;this.tableData=[],0!==t.length&&t.forEach(function(t,i){i%6==0&&e.tableData.push([]);var a=Math.floor(i/6);e.tableData[a].push(t)})}}});